import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="app"></div>;
      <Routes>
        <Route exact path="/checkout">
          <h1>Checkout</h1>
        </Route>
        <Route exact path="/login">
          <h1>Login Page</h1>
        </Route>
        <Route exact path="/">
          <h1>Home Page</h1>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
